import React from "react";
import { useSelector } from "react-redux";
import "./Header.module.css";

const Header = () => {
    const state = useSelector((state) => state);

    return (
        <header>
            <h2>{state.headerName.name}</h2>
            <p>{state.headerName.description}</p>
        </header>
    );
};

export default Header;
